// src/pages/Home.js

import React from 'react';
import Projects from '../components/Projects';

function Home() {
  return (
    <div>
      <section className="hero">
        <h1>Welcome to My Portfolio</h1>
        <p>Your quick introduction goes here.</p>
      </section>

      <Projects />
    </div>
  );
}

export default Home;
